import React from 'react';
import $ from 'jquery';
import './style.css';

function Homes() {
  const handleClick = (e) => {
    let button = $(e.target);

    if (!button.hasClass('animate')) {
      button.addClass('animate');
      setTimeout(() => {
        button.removeClass('animate');
      }, 10000);
    }
  };

  return (
    <section className="home">
      <button className="order" onClick={handleClick}>
        Click me
      </button>
    </section>
  );
}

export default Homes;
